import React from 'react';
import Product from './Product';

const ProductList = () => {
    let productList = [
        {
            "name": "product1",
            "price": "price1"        
        },
        {
            "name": "product2",
            "price": "price2"        
        },
        {
            "name": "product3",
            "price": "price3"        
        }
    ]
    return(
        <ul>
            {productList.map((elem, index) => {
            return (
                <li key={index}>
                     <Product >{"Nome: "+ elem["name"]+ " Price: "+elem["price"] }</Product>
                </li>
                )
           
            })
        }
        </ul>
        
    )
}

export default ProductList;
